export const historicalData = [
    { market: "S&P 500", price: 4500, volume: 1200000, trend: "Stable" },
    { market: "NASDAQ", price: 14000, volume: 800000, trend: "Bullish" },
    { market: "Dow Jones", price: 35000, volume: 600000, trend: "Bearish" },
   ];
   export const predictedData = [
    { market: "S&P 500", price: 4600, volume: 1250000, trend: "Bullish" },
    { market: "NASDAQ", price: 14200, volume: 850000, trend: "Bullish" },
    { market: "Dow Jones", price: 34500, volume: 590000, trend: "Stable" },
   ];
